// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.11;

import "./Interfaces.sol";

/**
 * @notice Error handling message for Modifier
 */
error Function__notAuthorized();

/**
 * @notice Error handling message for Main Function
 */
error MainFunction__insufficientBalance();

contract Whitelist {
    uint256 public privateSaleUsers;

    uint256 public privateSaleAmount;
    uint256 internal constant _phase1 = 73395000 * 1e18;
    uint256 internal constant _phase2 = 3820562 * 1e18; // daily limit

    uint256 public startPrivateSale;

    // beneficiary of tokens after they are released
    mapping(address => WhitelistStruct) private _beneficiary;

    address public _talax;
    address public _owner;

    constructor() {
        privateSaleAmount = 1467900000 * 1e18;
        _talax = msg.sender;
        _owner = msg.sender;
    }

    /* ------------------------------------------ modifier ------------------------------------------ */
    function _onlyTalax() internal view {
        // require(msg.sender == _talax, "Not authorized");
        if (msg.sender != _talax) {
            revert Function__notAuthorized();
        }
    }

    modifier onlyTalax() {
        _onlyTalax();
        _;
    }

    /* ---------------------------------------------- - --------------------------------------------- */

    function changeTalaxAddress(address talax) external onlyTalax {
        _talax = talax;
    }

    function beneficiary(address user)
        external
        view
        returns (
            uint256,
            uint256,
            bool,
            uint256
        )
    {
        WhitelistStruct memory beneficiary_ = _beneficiary[user];
        return (
            beneficiary_.lockedAmount,
            beneficiary_.amount,
            beneficiary_.isPhase1Claimed,
            beneficiary_.latestClaimDay
        );
    }

    function initiateWhitelist() external onlyTalax {
        startPrivateSale = block.timestamp;
    }

    function hasWhitelist(address user)
        external
        view
        returns (WhitelistStruct memory)
    {
        return _beneficiary[user];
    }

    /**
     *  @dev 		Main Functions
     *  @return 	Claimable amount from Locked Wallet
     */
    function _calculateClaimableAmount(address user)
        internal
        returns (uint256)
    {
        uint256 claimable;

        uint256 lockDuration = (block.timestamp - startPrivateSale) / 1 days;

        //Phase 1 of locked wallet release - monthly
        if (lockDuration < 16 * 30) {
            if (_beneficiary[user].isPhase1Claimed == false) {
                _beneficiary[user].isPhase1Claimed = true;
                _beneficiary[user].latestClaimDay = 15 * 30;
                claimable =
                    claimable +
                    ((_phase1 * _beneficiary[user].lockedAmount) /
                        privateSaleAmount);
            }
        }
        //Phase 2 of locked wallet release - daily
        else if (lockDuration >= 16 * 30 && lockDuration < 28 * 30) {
            if (_beneficiary[user].isPhase1Claimed == false) {
                _beneficiary[user].isPhase1Claimed = true;
                claimable =
                    claimable +
                    ((_phase1 * _beneficiary[user].lockedAmount) /
                        privateSaleAmount);
            }

            uint256 sinceLatestClaim = lockDuration -
                _beneficiary[user].latestClaimDay;
            _beneficiary[user].latestClaimDay = lockDuration;
            claimable =
                sinceLatestClaim *
                (claimable +
                    ((_phase2 * _beneficiary[user].lockedAmount) /
                        privateSaleAmount));
        } else {
            return 0;
        }

        return claimable;
    }

    function addBeneficiary(address user, uint256 amount) external onlyTalax {
        // require(amount <= privateSaleAmount, "Insufficient Total Balance");
        if (amount > privateSaleAmount) {
            revert MainFunction__insufficientBalance();
        }

        if (_beneficiary[user].amount > 0) {
            _beneficiary[user].lockedAmount = amount;
            _beneficiary[user].amount = amount;
            _beneficiary[user].isPhase1Claimed = false;
            _beneficiary[user].latestClaimDay = 1;

            privateSaleUsers += 1;
            privateSaleAmount -= amount;
        }
    }

    function deleteBeneficiary(address user)
        external
        onlyTalax
        returns (uint256)
    {
        if (_beneficiary[user].amount > 0) {
            privateSaleUsers -= 1;
            privateSaleAmount += _beneficiary[user].amount;
            uint256 ex_amount = _beneficiary[user].amount;

            delete _beneficiary[user];
            return ex_amount;
        } else {
            return 0;
        }
    }

    /**
     * @notice Transfers tokens held by timelock to beneficiary.
     */
    function releaseClaimable(address user)
        external
        onlyTalax
        returns (uint256)
    {
        if (_beneficiary[user].amount > 0) {
            uint256 claimableLockedAmount = _calculateClaimableAmount(user);

            if (claimableLockedAmount > 0) {
                _beneficiary[user].amount =
                    _beneficiary[user].amount -
                    claimableLockedAmount;

                return claimableLockedAmount;
            } else {
                return 0;
            }
        } else {
            return 0;
        }
    }
}

contracts/Interfaces.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.11;

struct WhitelistStruct {
    uint256 lockedAmount;
    uint256 amount;
    bool isPhase1Claimed;
    uint256 latestClaimDay;
}

struct Beneficiary {
    address user;
    uint256 amount;
}

interface IStakable {
    function stakingPenaltyRate() external view returns (uint256);

    function airdropRate() external view returns (uint256);

    function airdropSince() external view returns (uint256);

    function totalVoters() external view returns (uint256);

    function getVoters(address user) external view returns (bool, bool); // votingRight and voted

    function votedUsers(uint256 id) external view returns (uint256);

    function startAirdrop() external;

    function changeTalaxAddress(address talax) external;

    function stake(
        address user,
        uint256 amount,
        uint256 stakePeriod,
        uint256 rewardRate
    ) external;

    function changePenaltyFee(uint256 amount) external;

    function changeAirdropPercentage(uint256 amount) external;

    function withdrawStake(address user) external returns (uint256, uint256);

    function claimAirdrop(address user) external returns (uint256);

    function startVoting() external;

    function getVotingResult() external view returns (bool);

    function stopVoting() external;
}

interface IWhitelist {
    function privateSaleUsers() external view returns (uint256);

    function privateSaleAmount() external view returns (uint256);

    function startPrivateSale() external view returns (uint256);

    function changeTalaxAddress(address talax) external;

    function beneficiary(address user)
        external
        view
        returns (
            uint256,
            uint256,
            bool,
            uint256
        ); // lockedAmount, amount, isPhase1Claimed, latestClaimDay

    function initiateWhitelist() external;

    function addBeneficiary(address user, uint256 amount) external;

    function deleteBeneficiary(address user) external returns (uint256);

    function releaseClaimable(address user) external returns (uint256);
}

interface ILockable {
    function beneficiary() external view returns (address);

    function changeTalaxAddress(address talax) external;

    function startLockedWallet() external view returns (uint256);

    function initiateLockedWallet() external;

    function releaseClaimable(uint256[51] memory amount)
        external
        returns (uint256);
}

